 // Here, we display our Navbar
export default function Navbar() {
 return (
   <div>
     <nav className="navbar navbar-expand-lg navbar-light bg-light">

       
             <NavLink className="nav-link" to="/create">
               Create Record
             </NavLink>

     </nav>
   </div>
 );
}
